import React , {useState} from 'react'
import Modal from './Modal';
import './Modal.css'
export default function TeamAdmin() {
    const [show, setShow] = useState(false);
  return (
    <div id="popup-background" className={`w-full h-full ${show?"blur-md":""}`}>
      <div className='w-full h-[10%] bg-white absolute top-0'>
      <button type='button' className='bg-black border-2 flex text-cyan-200 rounded-lg' onClick={()=>{setShow(true)}}>Open Modal</button>
      </div>
      <div className='bg-black absolute'></div>
        <div className={`w-full h-full flex flex-col items-center justify-center`}>
        <Modal className={`${show?"backdrop-blur-xl":""}`} show={show} onClose={()=>{setShow(false)}}/>
        </div>
        
    </div>
  )
}
